import{_ as e,o,c as a,O as t}from"./chunks/framework.9482e208.js";const m=JSON.parse('{"title":"§ 53.1-204 If prisoner commits any other felony, how punished.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/53.1-204.md","filePath":"vacode/53.1-204.md"}'),r={name:"vacode/53.1-204.md"},n=t('<h1 id="§-53-1-204-if-prisoner-commits-any-other-felony-how-punished" tabindex="-1">§ 53.1-204 If prisoner commits any other felony, how punished. <a class="header-anchor" href="#§-53-1-204-if-prisoner-commits-any-other-felony-how-punished" aria-label="Permalink to &quot;§ 53.1-204 If prisoner commits any other felony, how punished.&quot;">​</a></h1><p>If a prisoner in a state, local or community correctional facility or in the custody of an employee thereof commits any felony other than those specified in §§ <a href="/vacode/18.2-31/">18.2-31</a>, <a href="/vacode/18.2-55/">18.2-55</a> and <a href="/vacode/53.1-203/">53.1-203</a>, which is punishable by confinement in a state correctional facility, such prisoner shall be subject to the same punishment therefor as if he were not a prisoner.</p><p>Code 1950, § 53-294; 1970, c. 648; 1975, c. 588; 1982, c. 636; 2021, Sp. Sess. I, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?212+ful+CHAP0344" target="_blank" rel="noreferrer">344</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?212+ful+CHAP0345" target="_blank" rel="noreferrer">345</a>.</p>',3),i=[n];function s(c,h,l,f,p,d){return o(),a("div",null,i)}const u=e(r,[["render",s]]);export{m as __pageData,u as default};
